Handlebars.registerHelper('formatDayLeft', function(string) {
    var a = Site.formatDate(string, '%Y%M%d');
    var newdate = moment(a, "YYYYMMDD").fromNow(); // 5 years ago
    var dayleft = moment(a, "YYYYMMDD").startOf('day',true).fromNow(); 
    return dayleft;
});

Handlebars.registerHelper('formatLatestDay', function(string) {
    var dayleft = moment.unix(string).startOf('hour',true).fromNow(); 
    return dayleft;
});

Handlebars.registerHelper('formatDayDMY', function(date) {
    var dateset = moment(date).format('DD-MM-YYYY');
    return dateset;
});

Handlebars.registerHelper('getRatingStar', function($number) {
	var starcontent = '';
	var $minnuscontent = 5-$number;
	
	for(var $i = 1;$i<=$number;$i++){
	    starcontent += '<i class="fa fa-star"></i>';
	}

	if($minnuscontent !=0){
		for(var $j = 1;$j<=$minnuscontent ;$j++){
	    	starcontent += '<i class="fa fa-star-o"></i>';
		}
	}

    return starcontent;
});